import React from "react";
import NavBar from "../components/NavBar";
import Intro from "../components/Intro";
import Footer from "../components/Footer";

const Home = () => {
  return (
    <div>
      <NavBar></NavBar>
      <Intro></Intro>
      <Footer></Footer>
    </div>
  );
};

export default Home;
